import amazonas from '../assets/piscinas fibratec/amazonas.png'
import ipanema from '../assets/piscinas fibratec/ipanema.png'
import mediterranea from '../assets/piscinas fibratec/mediterranea.png'
import spaDiamante from '../assets/piscinas fibratec/spaDiamante.png'
import spaIlhaRedonda from '../assets/piscinas fibratec/spaIRedonda.png'
import suprema from '../assets/piscinas fibratec/suprema.png'

export const imagesFibratec = [
  {
    label: 'Modelo – Amazonas',
    imgPath: amazonas
  },
  {
    label: 'Modelo – Ipanema',
    imgPath: ipanema

  },
  {
    label: 'Modelo – Mediterrânea',
    imgPath: mediterranea
  },
  {
    label: 'Modelo – SPA Diamante',
    imgPath: spaDiamante
  },
  {
    label: 'Modelo – SPA Ilha Redonda',
    imgPath: spaIlhaRedonda
  },
  {
    label: 'Modelo – Suprema',
    imgPath: suprema
  },
  {
    img: 'Catalagos/CatalagoFibratec'
  }

];
